import './App.css';
import ProfilePic from './images/profile_pic.jpg';
import Bio from './components/Bio.js';
import ActivityFeed from './components/ActivityFeed.js';

function App() {
  return (
	  <div className="App">
	  <div id="profile-pic">
	  <img src={ProfilePic} alt="Profile picture: Alex Trenam" width="100%"/>
	  </div>
	  <Bio/>
	  <ActivityFeed/>
	  </div>
  );
}

export default App;
